import {NavDropDown, Nav, Container, Navbar} from 'react-bootstrap';
import '../App.css';
import '../css/Header.css';

const Header =()=> {
  return (
/*         <header>
          <nav className='d-flex justify-content-between'>
            <div className='colore'>
              <h2>Cozy House</h2>
              <h6>Shelter for pets in Boston</h6>
            </div>
            <div className='d-flex gap-4 nav'>
              <a href='#'>About the shelter</a>
              <a href='#'>Our pets</a>
              <a href='#'>Help the shelter</a>
              <a href='#'>Contacts</a>
            </div>
          </nav>
        </header> */
        <Navbar bg="dark d-flex justify-content-between" data-bs-theme="dark">
        <Container>
          <Navbar.Brand href="#home">Navbar</Navbar.Brand>
          <Nav className="me-auto">
            <Nav.Link href="#home">Home</Nav.Link>
            <Nav.Link href="#features">Features</Nav.Link>
            <Nav.Link href="#pricing">Pricing</Nav.Link>
          </Nav>
        </Container>
      </Navbar>
  );
}
export default Header;
